import { Component } from "react";

const styles= {
    ul: {
        display: 'flex',
        justifyContent: 'center',
        listStyle: 'none', // Añadido para quitar los puntos de la lista
        padding: 0, // Añadido para eliminar el relleno predeterminado de la lista
    },
    li: {
        backgroundColor: 'rgba(255, 255, 255, 0.1)',
        borderRadius: '50%',
        color: '#fff',
        margin: '5px',
        width: '44px',
        height: '44px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        transition: 'background-color 250ms cubic-bezier(0.4, 0, 0.2, 1), transform 250ms cubic-bezier(0.4, 0, 0.2, 1)',
    },
    // Añadimos estilos específicos para el hover
    liHover: {
        backgroundColor: '#004e18',
        transform: 'scale(1.1)', // Aumentamos el tamaño en un 10%
    }
}

class Redes extends Component {
    render() {
        return (
            <div>
                <ul style={styles.ul}>
                    <li style={styles.li}>
                        <a href="https://www.instagram.com/herencialagalicia/">
                            <svg xmlns="http://www.w3.org/2000/svg" width="40" height="40">
                                <use href="/svg/gmail.svg"></use>
                            </svg>
                        </a>
                    </li>
                    {/* Agregar otras listas aquí */}
                </ul>
            </div>
        );
    }
}

export default Redes;
